import React, { Component } from 'react';
import { Container, Row, Col, Card, CardBody } from 'reactstrap';
import { Link } from 'react-router-dom';

//Import Icons
import FeatherIcon from 'feather-icons-react';

//Fade in effect
import FadeIn from 'react-fade-in';

//Import Images
import work1 from '../../assets/images/construction/o1.jpeg';
import work11 from '../../assets/images/construction/o11.jpeg';
import work2 from '../../assets/images/construction/b1.jpg';
import work22 from '../../assets/images/construction/b11.jpg';
import work3 from '../../assets/images/construction/r1.jpg';
import work33 from '../../assets/images/construction/r11.jpg';
import work4 from '../../assets/images/construction/b2.jpg';
import work5 from '../../assets/images/construction/r2.jpg';
import work6 from '../../assets/images/construction/o2.jpg';

class Projects extends Component {
  constructor(props) {
    super(props);
    this.state = {
      pathItems: [
        //id must required
        { id: 1, name: 'Landrick', link: '/' },
        { id: 2, name: 'Pages', link: '#' },
        { id: 3, name: 'Work', link: '#' },
        { id: 4, name: 'Classic' },
      ],
      works: [
        {
          image: work1,
          image2: work11,
          title: 'Before',
          title2: 'After',
          subtitle: 'Dealerships',
          category: 'Dealerships',
        },
        {
          image: work2,
          image2: work22,
          title: 'Before',
          title2: 'After',
          subtitle: 'Mockup',
          category: 'Buildings',
        },
        {
          image: work3,
          image2: work33,
          title: 'Before',
          title2: 'After',
          subtitle: 'Abstract',
          category: 'Roads',
        },
        // {
        //   image: work4,
        //   title: 'Yellow bg with Books',
        //   subtitle: 'Company V-card',
        //   category: 'Buildings',
        // },
        // {
        //   image: work5,
        //   title: 'Company V-card',
        //   subtitle: 'V-card',
        //   category: 'Roads',
        // },
        // {
        //   image: work6,
        //   title: 'Mockup box with paints',
        //   subtitle: 'Photography',
        //   category: 'Offices',
        // },
      ],
      displayCategory: 'All',
    };
    this.setCategory.bind(this);
  }

  setCategory(category) {
    this.setState({
      displayCategory: category,
    });
  }

  componentDidMount() {
    window.addEventListener('scroll', this.scrollNavigation, true);
  }
  // Make sure to remove the DOM listener when the component is unmounted.
  componentWillUnmount() {
    window.removeEventListener('scroll', this.scrollNavigation, true);
  }
  scrollNavigation = () => {
    var doc = document.documentElement;
    var top = (window.pageYOffset || doc.scrollTop) - (doc.clientTop || 0);
    var topnav = document.getElementById('topnav');
    if (top > 80 && topnav) {
      topnav.classList.add('nav-sticky');
    } else if (topnav) {
      topnav.classList.remove('nav-sticky');
    }
  };

  render() {
    return (
      <React.Fragment>
        {/* breadcrumb */}
        <Container className="mt-100 mt-60">
          <Row>
            <Col lg={4} md={6}>
              <div className="section-title sticky-bar position-sticky">
                <span className="badge rounded-pill bg-soft-primary">
                  Projects
                </span>
                <h4 className="title mt-3 mb-4">
                  Our latest projects <br /> check now dears
                </h4>
                <div className="mt-4 d-none d-md-block">
                  <Link to="#" className="btn btn-soft-primary">
                    See More{' '}
                    <i>
                      <FeatherIcon icon="arrow-right" className="fea icon-sm" />
                    </i>
                  </Link>
                </div>
              </div>
            </Col>
            <Col lg={8} md={6} className="mt-4 pt-2 mt-sm-0 pt-sm-0">
              <Row>
                <div className="col-12 filters-group-wrap">
                  <div className="filters-group">
                    <ul
                      className="container-filter list-inline mb-0 filter-options"
                      id="filter"
                    >
                      <li
                        onClick={() => this.setCategory('All')}
                        className={
                          this.state.displayCategory === 'All'
                            ? 'list-inline-item categories-name border text-dark rounded active'
                            : 'list-inline-item categories-name border text-dark rounded '
                        }
                      >
                        All
                      </li>{' '}
                      <li
                        onClick={() => this.setCategory('Dealerships')}
                        className={
                          this.state.displayCategory === 'Dealerships'
                            ? 'list-inline-item categories-name border text-dark rounded active'
                            : 'list-inline-item categories-name border text-dark rounded'
                        }
                      >
                        Dealerships
                      </li>{' '}
                      <li
                        onClick={() => this.setCategory('Buildings')}
                        className={
                          this.state.displayCategory === 'Buildings'
                            ? 'list-inline-item categories-name border text-dark rounded active'
                            : 'list-inline-item categories-name border text-dark rounded'
                        }
                      >
                        Buildings
                      </li>{' '}
                      <li
                        onClick={() => this.setCategory('Roads')}
                        className={
                          this.state.displayCategory === 'Roads'
                            ? 'list-inline-item categories-name border text-dark rounded active'
                            : 'list-inline-item categories-name border text-dark rounded'
                        }
                      >
                        {' '}
                        Roads
                      </li>
                    </ul>
                  </div>
                </div>
              </Row>

              <Row className="projects-wrapper">
                {this.state.works
                  .filter(
                    ({ category }) =>
                      this.state.displayCategory === category ||
                      this.state.displayCategory === 'All',
                  )
                  .map(({ title, title2, image, image2, subtitle }, key) => (
                    <Row key={key}>
                      <Col className="mt-4 pt-2 offices">
                        <FadeIn delay={100}>
                          <Card className="bg-light border-0 work-container work-classic shadow overflow-hidden">
                            <div className="mt-3 ms-lg-4 ms-md-3">
                              <h4 className=" para-desc">Auto Dealership</h4>
                              <p className="text-muted para-desc">
                                Enhance the look of your dealership while saving
                                money. Let your automobiles shine, and eliminate
                                the need to change bulbs and ballasts. The
                                rebate programs in place make now the time to
                                install LED lights.
                              </p>
                            </div>
                            <Row>
                              <Col>
                                <CardBody className="p-0">
                                  <Link to="page-work-detail">
                                    <img
                                      src={image}
                                      className="img-fluid work-image p-0"
                                      alt="Landrick"
                                    />
                                  </Link>
                                  <div className="content p-4">
                                    <h5 className="mb-0">
                                      <Link
                                        to="page-work-detail"
                                        className="text-dark title"
                                      >
                                        {title}
                                      </Link>
                                    </h5>
                                    <h6 className="text-muted tag mb-0">
                                      {subtitle}
                                    </h6>
                                  </div>
                                </CardBody>
                              </Col>
                              <Col>
                                <CardBody className="p-0">
                                  <Link to="page-work-detail">
                                    <img
                                      src={image2}
                                      className="img-fluid work-image"
                                      alt="Landrick"
                                    />
                                  </Link>
                                  <div className="content p-4">
                                    <h5 className="mb-0">
                                      <Link
                                        to="page-work-detail"
                                        className="text-dark title"
                                      >
                                        {title2}
                                      </Link>
                                    </h5>
                                    <h6 className="text-muted tag mb-0">
                                      {subtitle}
                                    </h6>
                                  </div>
                                </CardBody>
                              </Col>
                            </Row>
                          </Card>
                        </FadeIn>
                      </Col>
                    </Row>
                  ))}
              </Row>
            </Col>
          </Row>
        </Container>
      </React.Fragment>
    );
  }
}

export default Projects;
